import React from "react";
import s from "./RandomRecipeInfo.module.css";
import Button from "../../../ui/Button";
import CardInfo from "../../cardInfo/CardInfo";

export default function RandomRecipeInfo() {
  return (
    <div className={s.RandomRecipeInfo}>
      <CardInfo header="Deruny" text="Ukrainian Potato Pancakes" />
      <Button id="goToRecipe" text="Go to recipe!" />
    </div>
  );
}
